func NewStateStore(db ormtable.Schema) (StateStore, error) {
	serviceTable, err := NewServiceTable(db)
	if err != nil {
		return nil, err
	}

	credentialTable, err := NewCredentialTable(db)
	if err != nil {
		return nil, err
	}

	userTable, err := NewUserTable(db)
	if err != nil {
		return nil, err
	}

	baseParamsTable, err := NewBaseParamsTable(db)
	if err != nil {
		return nil, err
	}

	readParamsTable, err := NewReadParamsTable(db)
	if err != nil {
		return nil, err
	}

	writeParamsTable, err := NewWriteParamsTable(db)
	if err != nil {
		return nil, err
	}

	ownParamsTable, err := NewOwnParamsTable(db)
	if err != nil {
		return nil, err
	}

	return stateStore{
		serviceTable,
		credentialTable,
		userTable,
		baseParamsTable,
		readParamsTable,
		writeParamsTable,
		ownParamsTable,
	}, nil
}
